import React from 'react'; 
import { BrowserRouter, Routes, Route } from 'react-router-dom'; 
 
function App() { 
    return ( 
        <BrowserRouter> 
            <Routes> 
                <Route path="/" element={<h1>ESSSL Library</h1>} /> 
            </Routes> 
        </BrowserRouter> 
    ); 
} 
 
export default App;
